}

impl SkillRegistry {
    pub fn new() -> Self {
        Self {
            skills: Arc::new(RwLock::new(HashMap::new())),
            loaded_skills: Arc::new(RwLock::new(HashMap::new())),
        }
    }
    
    pub async fn discover_skills(&self, skills_dir: &Path) -> Result<(), SkillError> {
        let mut skills = self.skills.write().await;
        
        // Scan for skill directories
        for entry in std::fs::read_dir(skills_dir)? {
            let entry = entry?;
            let path = entry.path();
            
            if path.is_dir() {
                if let Some(skill) = self.load_skill_metadata(&path).await? {
                    skills.insert(skill.name.clone(), skill);
                }
            }
        }
        
        Ok(())
    }
    
    async fn load_skill_metadata(&self, skill_path: &Path) -> Option<SkillMetadata> {
        let skill_file = skill_path.join("SKILL.md");
        
        if !skill_file.exists() {
            return None;
        }
        
        // Read and parse frontmatter
        let content = std::fs::read_to_string(&skill_file).ok()?;
        let metadata = parse_skill_frontmatter(&content)?;
        
        Some(SkillMetadata {
            name: metadata.name,
            description: metadata.description,
            target_agent: metadata.target_agent,
            version: metadata.version,
            permissions: metadata.permissions,
            dependencies: metadata.dependencies,
            compatibility: metadata.compatibility,
            loading_priority: metadata.loading_priority,
        })
    }
    
    pub async fn get_skill(&self, skill_name: &str) -> Option<LoadedSkill> {
        let loaded = self.loaded_skills.read().await;
        loaded.get(skill_name).cloned()
    }
    
    pub async fn load_skill(&self, skill_name: &str) -> Result<LoadedSkill, SkillError> {
        let skills = self.skills.read().await;
        let metadata = skills.get(skill_name).cloned()
            .ok_or(SkillError::NotFound)?;
        
        // Check dependencies
        self.check_dependencies(&metadata).await?;
        
