class SkillLoader {
    private registry: SkillRegistry;
    private loadingPromises: Map<string, Promise<LoadedSkill>>;
    
    constructor() {
        this.registry = new SkillRegistry();
        this.loadingPromises = new Map();
    }
    
    async loadSkill(skillName: string): Promise<LoadedSkill> {
        // Check if already loading
        if (this.loadingPromises.has(skillName)) {
            return this.loadingPromises.get(skillName)!;
        }
        
        // Check if already loaded
        const existing = this.registry.getSkill(skillName);
        if (existing) {
            return existing;
        }
        
        // Start loading process
        const loadingPromise = this.registry.loadSkill(skillName);
        this.loadingPromises.set(skillName, loadingPromise);
        
        try {
            const skill = await loadingPromise;
            this.onSkillLoaded(skill);
            return skill;
        } finally {
            this.loadingPromises.delete(skillName);
        }
    }
    
    async preloadSkills(skillNames: string[]): Promise<void> {
        // Load skills in priority order
        const sortedSkills = this.sortByPriority(skillNames);
        
        for (const skillName of sortedSkills) {
            await this.loadSkill(skillName);
        }
