+/**
+ * AgentSkillRegistry
+ *
+ * Provides runtime access to the auto-generated agent + skill manifests so
+ * orchestration layers (Codex, Claude Code, CI scripts) can quickly discover
+ * the correct prompt, supporting skills, and Claude subagents for any
+ * Hearthlink development persona.
+ */
+
+import agentManifest, {
+  AgentManifest,
+  AgentEntry,
+  SubAgentEntry,
+} from './generated/agentManifest';
+
+import skillRegistry, {
+  SkillRegistryDocument,
+  SkillEntry,
+} from './generated/skillRegistry';
+
+export type SkillSourceType = SkillEntry['sourceType'];
+
+export interface ListSkillsOptions {
+  sourceType?: SkillSourceType;
+  linkedAgentId?: string;
+}
+
+export class AgentSkillRegistry {
+  constructor(
+    private readonly agents: AgentManifest = agentManifest,
+    private readonly skills: SkillRegistryDocument = skillRegistry,
+  ) {}
+
+  /** Return the canonical Hearthlink development agents. */
+  listAgents(): AgentEntry[] {
+    return this.agents.agents.map((agent) => ({ ...agent }));
+  }
+
+  /** Retrieve a single agent. */
+  getAgentById(agentId: string): AgentEntry | undefined {
+    return this.agents.agents.find((agent) => agent.id === agentId);
+  }
+
+  /** Claude subagents (context manager, organizer, etc.). */
+  listSubAgents(): SubAgentEntry[] {
+    return this.agents.subAgents.map((agent) => ({ ...agent }));
+  }
+
+  getSubAgentById(subAgentId: string): SubAgentEntry | undefined {
+    return this.agents.subAgents.find((subAgent) => subAgent.id === subAgentId);
+  }
+
+  /** All skills from both `.claude` and `.chatgpt/Claude`. */
+  listSkills(options: ListSkillsOptions = {}): SkillEntry[] {
+    const { sourceType, linkedAgentId } = options;
+
+    return this.skills.entries.filter((entry) => {
+      if (sourceType && entry.sourceType !== sourceType) {
+        return false;
+      }
+      if (linkedAgentId && !entry.linkedAgents.some((agent) => agent.id === linkedAgentId)) {
+        return false;
+      }
+      return true;
+    });
+  }
+
+  getSkillById(skillId: string): SkillEntry | undefined {
+    return this.skills.entries.find((entry) => entry.id === skillId);
+  }
+
+  getSkillBySourceFile(relativePath: string): SkillEntry | undefined {
+    return this.skills.entries.find((entry) => entry.sourceFile === relativePath);
+  }
+
+  /** Skills referenced by a primary Hearthlink agent. */
+  getSkillsForAgent(agentId: string): SkillEntry[] {
+    return this.listSkills({ linkedAgentId: agentId });
+  }
+
+  /** Primitive search helper for CLI tooling / quick lookups. */
+  searchSkills(query: string): SkillEntry[] {
+    const normalized = query.trim().toLowerCase();
+    if (!normalized) {
+      return [];
+    }
+
+    return this.skills.entries.filter((entry) => {
+      const haystacks = [
+        entry.name,
+        entry.title,
+        entry.description,
+        entry.summary,
+        entry.sourceType,
+        entry.sourceFile,
+        ...entry.linkedAgentNames,
+      ].map((value) => value?.toLowerCase?.() ?? '');
+      return haystacks.some((haystack) => haystack.includes(normalized));
+    });
+  }
+
+  /** Machine metadata useful for telemetry or cache validation. */
+  info() {
+    return {
+      agentManifest: {
+        generatedAt: this.agents.generatedAt,
+        totalAgents: this.agents.totalAgents,
+        totalSubAgents: this.agents.totalSubAgents,
+      },
+      skillRegistry: {
+        generatedAt: this.skills.generatedAt,
+        totalSkills: this.skills.totalSkills,
+        sources: this.skills.sources,
+      },
+    };
+  }
+}
+
+export const agentSkillRegistry = new AgentSkillRegistry();
+
+export default agentSkillRegistry;
