    fs.mkdirSync(outputDir, { recursive: true });
    console.log(`�o. Created directory: ${outputDir}\n`);
  }

  let totalSavings = 0;
  const results = [];

  for (const img of images) {
    const filename = path.basename(img.src, '.png');
